      <button onClick={() => onMenuClick('eliminar')}>Eliminar Riesgo</button>
      <button onClick={() => onMenuClick('modificar')}>Modificar Riesgo</button>
      <button onClick={() => onMenuClick('ver')}>Ver Riesgos</button>
    </div>
  );
}

